B.JS=new A.jq("Village Court GPS Monitoring System (UNDP)","assets/images/undp.jpg","The system enhances village court operations with Google Maps integration, robust location tracking, and offline monitoring. It ensures secure user authentication, background services, and employee management, enabling seamless supervision and improved transparency in court activities, even in areas with limited connectivity","https://github.com/afiksourav/UNDP-AVCB-GEMS-Flutter-main.git","https://youtu.be/HSIosFd6Sys")
B.JR=new A.jq("Bangladesh police Online GD App","assets/images/online_gd.jpg","Online GD App enables users to file General Diaries (GD) securely and efficiently.The app offers authentication to ensure that only authorized individuals can access the system. Users can submit incident reports directly through the app, attaching any relevant documents with ease. Tracking and monitoring features allow users to check the progress of their GD and receive updates in real-time. The app prioritizes data security, keeping all personal and report information safe from unauthorized access. Accessibility features ensure that the app is easy to use for all individuals, and the built-in search and reporting tools help in quickly retrieving filed GDs and generating necessary reports.","Null","https://youtu.be/MuuVjqrR49g")
B.JP=new A.jq("NBR Vat Collection Pos System (Govt Project)","assets/images/IMG_8372.PNG","The NBR VAT Collection POS System is a specialized solution designed to facilitate government VAT collection while helping sellers efficiently manage their sales. This system ensures compliance with VAT regulations by automatically calculating and recording VAT for every transaction. It includes features such as Quick Items Sales for fast transactions, Single and Bulk Item Entry for seamless product management, and an Item Discount Feature for flexible pricing options.With Stock Movement Tracking and Exchange Items functionality, businesses can efficiently monitor inventory changes. The system also supports Offline Sales, allowing transactions even without an internet connection. Additionally, it provides comprehensive sales reports, including X Report, Z Report, and Sales Summary, which help businesses track their sales performance and meet regulatory requirements. The integration of background services ensures smooth operation, while the Employee Management module helps businesses oversee staff activities efficiently.","https://t.ly/QZnOO","link")
B.JV=new A.jq("Quizva: The Ultimate Quiz Experience ","assets/images/quiz12.jpg","Quizva is a powerful quiz application designed for interactive learning and competition. It offers Quiz Creation and Management, allowing users to create and organize quizzes easily. With User Authentication, participants can securely log in and track their progress. The app supports Real-time Quiz Participation with Scoring and Leaderboard features for a competitive experience.Quizva ensures Multi-platform Accessibility, making it available across different devices. It supports diverse Question Types and provides Progress Tracking to help users improve. Additionally, the Social Sharing feature allows users to share achievements, while the User-Friendly Interface ensures a seamless experience.","https://github.com/afiksourav/quiz_project.git","https://youtu.be/3nU_dYjsPsg")
B.JU=new A.jq("Restaurant food delivery System","assets/images/food delivary.PNG","The Restaurant Food Delivery Mobile Application is a user-friendly platform designed to enhance the online food ordering experience. It seamlessly loads food items from an API, ensuring that users always have access to the latest menu updates. The app features an intuitive Add to Cart option, allowing customers to easily select and manage their desired food items before placing an order. Additionally, the Favorite Food Feature enables users to save their preferred dishes for quick access in future orders.For a smooth ordering process, the app includes a Checkout system that ensures hassle-free payment and order confirmation. Users can also manage their details through the User Profile section, making it convenient to track orders and update personal information. With a Responsive UI Design, the application delivers a seamless experience across different devices, ensuring a visually appealing and easy-to-navigate interface for all users","https://github.com/afiksourav/Restaurant-food-delivery-services.git","https://youtu.be/s1KFdBKNFig")
B.JT=new A.jq("Chatting App With Firebase","assets/images/chatapp.PNG",'The "Chatting App with Firebase" is a real-time messaging application that allows users to log in and register for an account, ensuring secure authentication through Firebase. Users can send and receive messages, with their chat history saved for easy reference. The app also includes features like sending and receiving friend requests, enabling users to connect with others. Additionally, users can search for other individuals to start conversations, and they have the ability to delete users from their friend list or block them as necessary. This project utilizes Firebase for backend functionality, ensuring smooth communication and user management.',"https://github.com/afiksourav/ChattingApp-using-FIrebase.git","https://youtu.be/wK9Y9BhP190")
B.JQ=new A.jq("Bangladesh police Rail Seba App","assets/images/rail.jpg",'"Rail Seba" is an innovative and user-friendly app designed to give the public a powerful tool to report any issues encountered with rail services. With this app, users can easily file complaints and upload supporting evidence such as photos, audio, and videos to substantiate their claims. To ensure secure and accurate submissions, users are required to register using their national ID. The app also allows police users to view and assess the complaints, taking necessary actions to address and resolve the issues quickly. Additionally, "Rail Seba" offers a real-time train location tracking feature, providing users with up-to-date information about their train whereabouts. Users can also monitor the progress of their complaints, receiving notifications on their resolution status, making the app an essential tool for enhancing the transparency, efficiency, and overall experience of rail services.',"Null","link")
